<!DOCTYPE html><html lang="en"><head><meta charset="UTF-8"><meta name="viewport" content="width=device-width,initial-scale=1"><title>Master | mstr.ws</title><style>.error-box{display:inline-block;position:fixed;top:0;left:0;padding:.4rem 1.5rem .6rem;width:auto;background:rgba(255,255,255,.8);border:1px solid #ed6c63;border-bottom-right-radius:5px;color:#ed6c63}.top-line{height:5px!important;width:100%;background:linear-gradient(to right,#d9eaf9 0,#1fc8db 30%,#24e6ac 70%,#eaf7ff 100%);}.main-spinner{width:30px!important;height:30px!important;background:linear-gradient(to right,#1fc8db 0%,#24e6ac 100%);margin:0!important;position:fixed;left:calc(50% - 15.1px);top: 30%;animation: sk-rotateplane 3s infinite ease-in-out;}@keyframes sk-rotateplane {0%{transform:perspective(90px) rotateX(0deg) rotateY(0deg);}25%{transform:perspective(90px) rotateX(-180deg) rotateY(0deg);}50%{transform:perspective(90px) rotateX(-180deg) rotateY(-180deg);}75%{transform:perspective(90px) rotateX(-360deg) rotateY(-180deg);}100%{transform:perspective(90px) rotateX(-360deg) rotateY(0deg);}}</style></head><body><div id="root"><div class="top-line"></div><div class="main-spinner"></div></div><script>window.addEventListener("error",function(e){var t=document.createElement("div");t.className="error-box",t.textContent=e.message,document.body.appendChild(t);},!1);</script><link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/bulma/0.1.0/css/bulma.min.css"><link href="/static/components/font-awesome/css/font-awesome.min.css" rel="stylesheet" lazyload><link href="/static/styles/css/main.min.css" rel="stylesheet" lazyload><script src="/static/js/common.js" defer></script><script src="/static/js/app.js" defer><script src="/static/js/ga.js"></script></script></body></html>
